    [],nt"num_tags": 4,nt"name": "narrative-report-crescent-lake-national-wildlife-refuge-period-ending-december-31-1949",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1949. The report begins by summarizing the weather conditions and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, and raptors- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    plantings. The public relations section of the report describes Refuge visitors.
